import Styles from '../register/styles.css';

export default function Register() {

  

    return (
      
      <div class="container">
        <Form> 
    <Field type="email" name="email" />
    <Field type="password" name="password" />
    <Field name="address.city.name" />
    <button type="submit" >
      Submit
    </button>
  </Form>
  </div>
    );
  }
